class Facebook extends React.Component {

    constructor(props) {
        super(props);

        var result = JSON.parse(props.alldata);
        this.state = {
            allpagesdata:result.data
        }

    }

    render() {
        // let pageContent;

        return <div>{this.state.allpagesdata}</div>;
    }
}


export default Facebook;
